const profile_photo=()=>{
    if (sessionStorage.session){
        let id = JSON.parse(localStorage.getItem('login_data')).user_id
        return id
    }
    else{
        let id = "unknown"
        return id
    }
}
const logout = ()=>{
    delete sessionStorage.session
}



export {profile_photo}
